mapper.select:

select * from t_sjduochu
WHERE 1=1

	 AND sjduochuDate >= #{sdate,jdbcType=TIMESTAMP} 


	 AND sjduochuDate <= #{edate,jdbcType=TIMESTAMP} 


	 AND sjduochuDate1 >= #{sdate1,jdbcType=TIMESTAMP} 


	 AND sjduochuDate1 <= #{edate1,jdbcType=TIMESTAMP} 



		 AND sjduochuName = #{sjduochu.sjduochuName} 


		 AND sjduochuId = #{sjduochu.sjduochuId} 


		 AND sjduochuType = #{sjduochu.sjduochuType} 


		 AND sjduochuType1 = #{sjduochu.sjduochuType1} 


		 AND sjduochuType2 = #{sjduochu.sjduochuType2} 


		 AND sjlaiyuanId = #{sjduochu.sjlaiyuanId} 


		 AND sjqitaId = #{sjduochu.sjqitaId} 


		 AND shujuId = #{sjduochu.shujuId} 


		 AND sjleixingId = #{sjduochu.sjleixingId} 


		 AND sjxingtaiId = #{sjduochu.sjxingtaiId} 


		 AND yonghuId = #{sjduochu.yonghuId} 


		 AND byumenId = #{sjduochu.byumenId} 


		 AND yhroleId = #{sjduochu.yhroleId} 


		 AND byuyuanId = #{sjduochu.byuyuanId} 


		 AND byuzhiId = #{sjduochu.byuzhiId} 


		 AND userId = #{sjduochu.userId} 


		 AND bumenId = #{sjduochu.bumenId} 


		 AND buyuanId = #{sjduochu.buyuanId} 


		 AND buzhiId = #{sjduochu.buzhiId} 


		 AND roleId = #{sjduochu.roleId} 


order by sjduochuId 

	limit #{page},#{rows}
